import React from 'react';


export class Prizes extends React.Component {

    constructor(props) {
        super(props);
        var prizeArr = this.createPrizeArr();
    }


    render() {

        var refers = this.props.refers;

        if (refers === 0)
        {
            return (
                <ul>
                    <li>Free Prize for Creating Account</li>
                </ul>
            );
        }
        else if (refers > 0 && refers < 2)
        {
            return (
                <ul>
                    <li>Free Prize for Creating Account</li>
                    <li>Prize 2</li>
                </ul>
            );
        }
        else if (refers > 1 && refers < 3)
        {
            return (
                <ul>
                    <li>Free Prize for Creating Account</li>
                    <li>Prize 2</li>
                    <li>Prize 3</li>
                </ul>
            );
        }
        else
        {
            return (
                <ul>
                    <li>Free Prize for Creating Account</li>
                    <li>Prize 2</li>
                    <li>Prize 3</li>
                    <li>Prize 4</li>
                </ul>
            );
        }
    }
}

export default Prizes;
